import "./styles.css";

export default function App() {
  return <Greeting name="Marcin" />;
}

function Greeting({ name }) {
  const coaches = ["Gimena", "Klaus", "Marcel"];
  return (
    <div>
      <h1>Hello, {coaches.contains(name) ? "Coach" : name}!</h1>;
    </div>
  );
}
